import {
  loadChofers,
  createChofers,
  updateChoferes,
  deleteChoferes,
  clearchoferes,
} from "../../actions/choferesActions";

import service from "../../helpers/servicesAxios";

const getChoferes = () => {
  return (dispatch) => {
    service.get("/choferes/").then((res) => {
      console.log("ver res", res);
      dispatch(loadChofers(res));
    });
  };
};

export default { getChoferes };
